  Frederick b. and m. at Gisborne. Mary, d/o Robert Keith Murphy and Enid Constance Williams, b. at
  Gisborne.
  Fred was educated at Hereworth School and Wanganui Collegiate School and then worked on various farm
  properties in Hawkes Bay. During WW2 he served in the Middle East and the Pacific and afterwards farmed
  the family property, "Wairakaia" until he retired to Wainui Beach in 1967. He took an active interest
  in the New Zealand Farm Forestry Association and was a member of the Eastwood Hill Trust Board.
  01> FAULKNER, Rodney George m on 08.07.1967 to HAINES, Sarah Christina
  b 09.09.1941
  b 09.07.1939
  Rodney b. at Gisborne and m. at Auckland. Sarah, d/o Lt Col GT Haines and MC Guise, b, at
  Portsmouth, England. Address: "Wairakaia" Station, 1952 State Highway 2, RD 9, Gisborne.
  Rodney and Sarah have been farming at "Wairakaia" since the retirement of Rodney's father in 1967.
  Their son Robert returned in 1995 to take over responsibility for the livestock on the farm,
  enabling them to devote more time to their extensive garden and homestay business. Rodney is a
  member of the Eastwood Hill Trust Board representing the Farm Forestry Association.
  01> FAULKNER, Joanna Mary
  b 23.10.1968
  Joanna b. at Gisborne. Address: 478 Waingake Valley, RD, Manutuke, Gisborne.
  Jo was educated at Gisborne Girls' High School then spent a year in Indonesia as an AFS
  Exchange Student before attending Auckland University to complete a degree in Asian Studies.
  She returned to Indonesia to a teaching position and has since travelled widely. She returned
  to Gisborne in 1997 and purchased a small property at Manutuke. She is currently teaching
  English to Asian students at Tairawhiti Polytechnic.
